css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("scikit-learn.org") {
    .container-fluid.sk-docs-container.px-0 {
        background-color: black;
    }
    a.sk-nav-link.nav-link {
        color: #cdcdcd;
    }
    #sk-sidebar-wrapper {
        background-color: black;
    }
    div.sk-sidebar-toc.ul.li {
        color: lightblue;
    }

    .sk-page-content.container-fluid.body.px-md-3 {
        background-color: black;
        color: #cdcdcd;
    }
    code {
        background-color: #443f3f;
        color: #cdcdcd;
    }
    span.pre {
        color: lightblue;
    }
}
